struct s2n_hash_state signature_hash;
struct s2n_stuffer *in = &conn->handshake.io;
struct s2n_blob serverECDHparams, signature;
uint16_t signature_length;

// Read server ECDH params
GUARD(s2n_ecc_read_ecc_params(&conn->pending.server_ecc_params, in, &serverECDHparams));

if (conn->actual_protocol_version == S2N_TLS12) {
    // Generate the signature
    hash_algorithm = S2N_HASH_ALGORITHM_SHA256;
    GUARD(s2n_hash_generate(&signature_hash, in, &serverECDHparams, &signature_length));
} else {
    // Generate the signature using the default hash algorithm for this protocol version
    hash_algorithm = S2N_HASH_ALGORITHM_DEFAULT;
    GUARD(s2n_hash_generate(&signature_hash, in, &serverECDHparams, &signature_length));
}

// Write the signature to the output buffer
